// --- aqlite.FDb.ns.qFind
// 'quick' Access row by row id. No bounds checking.
inline aqlite::FNs& aqlite::ns_qFind(u64 t) {
    u64 x = t + 1;
    u64 bsr   = algo::u64_BitScanReverse(x);
    u64 base  = u64(1)<<bsr;
    u64 index = x-base;
    return _db.ns_lary[bsr][index];
}

